import './App.css';
import Header from './components/Header/Header';
import React, { useEffect, useState } from 'react'; 
import { createStyles, Grid, makeStyles, Paper } from '@mui/material';

const useStyles = makeStyles({
  root: {
    '& .MuiGrid-root': {
      boxShadow: 'none',
    },
  },
});

function App() {
  const classes = useStyles();
  const ACCESS_KEY = 'sL5OjT3ArXKeTik_nUhUsydu5RRNXhCWqHajBMymaW8'; 
  const [images, setPhotos] = useState([]);

  useEffect(() => {
    fetch(`https://api.unsplash.com/photos?client_id=${ACCESS_KEY}`)
      .then(response => response.json())
      .then(data => {
        console.log(data);
        const parsedData = data.map(images => {
          return {
            id: images.id,
            url: images.urls.thumb,
            user: images.user.name,
            likes: images.likes
          };
        });
        setPhotos(parsedData);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div className="App">
       <Header/>
       <Grid className="image-grid" container spacing={3}>
          {images.map(photo => (
            <Grid className="single-image-grid" key={photo.id} item xs={4}>
                <Paper>
                  <div className="e-card">
                    <div className="e-card-image" style={{backgroundImage: `url(${photo.url})`,}}>
                      <div className="e-card-title">JavaScript </div>
                    </div>
                    <div className="e-card-content">
                      JavaScript Succinctly was written to give readers an accurate, concise examination of JavaScript objects and their supporting nuances, such as complex values, primitive values, scope, inheritance, the head object, and more. </div>
                  </div>
                </Paper>
            </Grid>
            // <div key={photo.id}>
            //   <img src={photo.url} alt={photo.id} />
            //   <p>Photo by {photo.user}</p>
            //   <p>{photo.likes} likes</p>
            // </div>
          ))}
       </Grid>
    </div>
  );
}

export default App;
